    public static void reverseString(char[] s) {
        if (s.length == 0) {
            return;
        }
        int l = 0;
        int r = s.length - 1;

        do {
            int a = s[l];
            int b = s[r];
            a = a + b;
            b = a - b;
            a = a - b;
            s[l] = (char) a;
            s[r] = (char) b;
            r--;
            l++;
        } while (l < r);
    }

    public static boolean isPalindrome(String s) {
        if (s == null || s.length() == 0) return true;
        StringBuilder alphnum = new StringBuilder();

        for (int i = 0; i < s.length(); i++) {
            char a = s.charAt(i);
            if (47 < a && a < 58) {
                alphnum.append(a);
            } else if (64 < a && a < 91) {
                alphnum.append(a);
            } else if (96 < a && a < 123) {
                alphnum.append(a);
            } else {
                continue;
            }
        }


        int l = 0, r = alphnum.length() - 1;
        while (l < r) {
            char a = alphnum.charAt(l);
            char b = alphnum.charAt(r);


            if ((a - b) == 0) {
                l++;
                r--;
            } else if ((64 < a && a < 91) && (96 < b && b < 123) && (a - b) == -32) {
                l++;
                r--;
            } else if ((64 < b && b < 91) && (96 < a && a < 123) && (a - b) == 32) {
                l++;
                r--;
            } else {
                return false;
            }
        }

        return true;
    }

    public static int subtractProductAndSum(int n) {
        int multipler = 1;
        int sum = 0;
        int newN = n;
        while (n > 0) {
            int lastDigit = n % 10;
            multipler *= lastDigit;
            n /= 10;
        }

        while (newN > 0) {
            int lastDigit = newN % 10;
            sum += lastDigit;
            newN /= 10;
        }
        return multipler - sum;
    }

