    public static int[] twoRecSum(int left, int right, int[] numbers, int target) {
        if (numbers[left] + numbers[right] != target)  {
            if (numbers[left] + numbers[right] < target) {
                left++;
                twoRecSum(left, right, numbers, target);
            } else {
                right--;
                twoRecSum(left, right, numbers, target);
            }
        }
        return new int[]{left+1, right+1};
    }

